import Link from "next/link";

const nav = () => {
    return (
        <nav className="d-flex justify-content-between pl-3 pr-3">
            <Link href="/"><a href="">홈</a></Link>
            <Link href="/"><p>랭킹</p></Link>
            <Link href="/"><p>통계</p></Link>
            <Link href="/"><p>소식</p></Link>
        </nav>
    );
};

export default nav;
